    "oxygen-percent-saturation-dissolved-oxygen-water-temperature-fluorescence-and-other-profile-da",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0113947 includes profile,
    biological, chemical and physical data collected aboard the NEW HORIZON, RANGE RECOVERER,
    THOMAS G. THOMPSON and WECOMA during cruises NH0005, NH0007, NH0207, R0208, T0205,
    W0005A, W0008 and W0205A in the North Pacific Ocean from 2000-05-30 to 2002-08-19.
    These data include OXYGEN - PERCENT SATURATION, DISSOLVED OXYGEN, WATER TEMPERATURE,
    FLUORESCENCE, PHOTOSYNTHETIC ACTIVE RADIATION (PAR), TRANSMISSIVITY, SALINITY, SIGMA-THETA
    and Potential temperature (theta). The instruments used to collect these data include
    CTD. These data were collected by Hal Batchelder of Oregon State University as part
    of NEP. The Biological and Chemical Oceanography Data Management Office (BCO-DMO)
    submitted these data to NODC on 2013-09-28.nnThe following is the text of the abstract
